import React, { Component } from 'react';
import Image2 from '../Image/50-Beautiful-and-Minimalist-Presentation-Backgrounds-042.jpg';
import '../Bar-contents/Departments.css';
import { Link } from 'react-router-dom';
import Navigation from '../Navigation/Navigation';
import { VOContainer, VOHeader, VOMain, VOButton, VOGrid, VOGridItem, VOText, VOImage } from '@vercel/vo';  // Import VO Components

class Student extends Component {
  onDeletedClick = (subscriberId) => {
    this.props.deleteSubscriberHandler(subscriberId);
  };

  render() {
    return (
      <VOContainer>
        {/* VOHeader for the top navigation bar */}
        <VOHeader>
          <Navigation />
        </VOHeader>

        {/* Background image for the student section */}
        <VOMain>
          <VOImage
            src={Image2}
            alt="Background"
            style={{ width: '100%', height: 'auto', position: 'relative', backgroundSize: 'cover' }}
          />
          
          {/* Section title */}
          <div style={{ position: 'absolute', top: '5%', left: '5%', color: 'white', textDecoration: 'underline' }}>
            <h1>Add New Student Section</h1>
          </div>

          {/* Student list using VOGrid for better layout */}
          <div style={{ position: 'relative', top: '10%', color: 'white' }}>
            <VOGrid columns={5} className="grid-header">
              <VOGridItem><VOText>S.No.</VOText></VOGridItem>
              <VOGridItem><VOText>NAME/PHONE</VOText></VOGridItem>
              <VOGridItem><VOText>REGISTRATION NO.</VOText></VOGridItem>
              <VOGridItem><VOText>BRANCH</VOText></VOGridItem>
              <VOGridItem><VOText>ACTION</VOText></VOGridItem>
            </VOGrid>

            {/* Dynamic student list */}
            {this.props.DepartmentList.map((student, index) => (
              <VOGrid key={student.ids} columns={5} className="grid-row">
                <VOGridItem><VOText>{index + 1}</VOText></VOGridItem>
                <VOGridItem><VOText>{student.name} / {student.phone}</VOText></VOGridItem>
                <VOGridItem><VOText>{student.Reg}</VOText></VOGridItem>
                <VOGridItem><VOText>{student.branch}</VOText></VOGridItem>
                <VOGridItem>
                  <VOButton onClick={() => this.onDeletedClick(student.ids)} className="delete-btn">Delete</VOButton>
                </VOGridItem>
              </VOGrid>
            ))}

            {/* Add new student button */}
            <Link to="/add">
              <VOButton className="custom-btn add-btn">Add Student</VOButton>
            </Link>
          </div>
        </VOMain>
      </VOContainer>
    );
  }
}

export default Student;
